import React from 'react'
import './bingopage.css'

const BingoPage = () => {
  return (
    <div className='bingo-container'>
        <div className='bingo-box'>
            {
                [0,1,2,3,4,5,6,7,8].map((num)=>(
                    <div  key={num}>
                        {num+1}
                        </div>
                ))
            }
        </div>
    </div>
  )
}

export default BingoPage
